import * as React from "react";
import Container from "@mui/material/Container";
import Box from '@mui/material/Box';

export default function Footer() {
  return (
    <>
      <Container>
      <Box sx={{ bgcolor: '#cfe8fc', height: '2vh', backgroundSize: "cover" }} />
      </Container>
    </>
  );
}
